import React from "react";
import Navigation from './Navigation'

const Header = () => (
   <>
   <Navigation/>
   <style jsx>{`
  nav.navbar {
    background-color: transparent;
  }
  .nav_signup_btn{
    width: 150px;
    height: 33px;
    border-radius: 8px;
    border: solid 2px #fff;
    background: 0 0;
    font-size: 14px;
    font-weight: 600;
    font-stretch: normal;
    font-style: normal;
    line-height: normal;
    letter-spacing: normal;
    color: #fff;
  }
  .nav_signup_btn {
    color: #7d44f0;
    background-color: #fff;
  }
  .nav_login_btn{
    width: 83px;
    height: 33px;
    border-radius: 8px;
    background-color: #fff;
    font-size: 14px;
    font-weight: 600;
    font-stretch: normal;
    font-style: normal;
    line-height: normal;
    letter-spacing: normal;
    color: #7d44f0;
  }
`}</style>
   </>
);

export default Header;
